import React from 'react';
import logo from './logo.svg';
import './App.css';
import './main.css';

const dados = {
  titulo: "Game Fifteen",
}

function App() {
  return (
    <div className="border">
      <h1>
        {dados.titulo}
      </h1>
      <div className="box"></div>
    </div>
  );
}

export default App;
